    `metro` VARCHAR(31) CHARACTER SET utf8,
    `StateCodeFIPS` INT,
    `MunicipalCodeFIPS` INT,
    `SizeRank` INT,
    `mean_2010` NUMERIC(19, 15),
    `mean_2011` NUMERIC(19, 15),
    `mean_2012` NUMERIC(19, 15),
    `mean_2013` NUMERIC(19, 15),
    `mean_2014` NUMERIC(19, 15),
    `mean_2015` NUMERIC(19, 15),
    `mean_2016` NUMERIC(19, 15),
    `mean_2017` NUMERIC(19, 15),
    `mean_2018` NUMERIC(19, 15),
    `mean_2019sqft` NUMERIC(19, 15)
